import React from 'react';
import dog from './dog.png';

const Boxes = ({ name }) => {
	return (
		<div className="black f4">
			{`${name}, pick your favorite pet and fill out an application`}
			<div>
				<img className='h-15 w-15' alt='golden retriever' src={dog} />
					<div>
			  			<h2>Nensi</h2>
			  			<p>Golden Retriever</p>
				</div>
				<img className='h-15 w-15' alt='golden retriever' src={dog} />
					<div>
			  			<h2>Ne</h2>
			  			<p>Gold Retriever</p>
				</div>
			</div>
			<div className="row">
    			<div className="col-sm-6">Card 1</div>
    			<div className="col-sm-6">Card 2</div>
			</div>
		</div>
	);
}

export default Boxes;
